import React, { Component } from "react";
import { Message, Header, Image } from "semantic-ui-react";
import simplyRoleplayImage from "../Images/simplyRoleplay.png";

class RoleplayWebsite extends Component
{
    render()
    {
        return (
            <div>
                <Message color="black">
                    <Message.Header style={{ textAlign: "center" }}>
                        <Header as="h1" color="blue">Roleplay Website</Header>
                    </Message.Header>
                    <Message.Content className="scrolling">
                        <Image src={simplyRoleplayImage} className="project-image" style={{ maxWidth: "100%", minHeight: "100px", maxHeight: "500px", marginRight: "auto", marginLeft: "auto" }} />
                        <Header as="h3" style={{ textAlign: "center" }} color="blue">Idea</Header>
                        <Header as="h3" style={{ textAlign: "center" }} color="blue">Frontend</Header>
                        <Header as="h3" style={{ textAlign: "center" }} color="blue">Backend</Header>
                        <Header as="h3" style={{ textAlign: "center" }} color="blue">Deployment</Header>
                    </Message.Content>
                </Message>
            </div>
        );
    }
}

export default RoleplayWebsite;
